import React from 'react';

import './App.css';

function App() {
  return (
    <div className="content">
      <header className="contentHeader a-c">
        <div className="headerLeft">
        <img width="24" src="./images/menu.svg" alt="menu" />
        </div>
        <div className="headerCenter">
        <img width="75" src="./images/logo.svg" alt="logo" />
        </div>
        <div className="headerRight">
          <div className="bag a-c j-c">
            <span className="bagQuantity">1</span>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
